import { createStore } from 'vuex'

export default store = createStore({
  state(){
    return{
      data:"eee"
    }
  },
  getters: {
  },
  mutations: {
    sendTodo(state,params) {
      state.data = params
    }
  },
  actions: {
    increment({ commit } , data) {

      commit('sendTodo',data)

    }
  },
  modules: {
  }
})
